import React from 'react';
import { Activity } from 'lucide-react';

const CronLogs = ({ cron, onClose }) => {
  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center p-4 z-50">
      <div className="bg-white rounded-lg max-w-4xl w-full max-h-[80vh] overflow-hidden">
        {/* Cabeçalho do modal */}
        <LogsHeader cronName={cron.name} onClose={onClose} />
        
        {/* Conteúdo dos logs */}
        <LogsContent logs={cron.logs || []} />
      </div>
    </div>
  );
};

// Cabeçalho do modal de logs
const LogsHeader = ({ cronName, onClose }) => {
  return (
    <div className="p-6 border-b border-gray-200">
      <div className="flex justify-between items-center">
        <h2 className="text-xl font-bold text-gray-900">
          Logs - {cronName}
        </h2>
        <button
          onClick={onClose}
          className="text-gray-500 hover:text-gray-700 text-2xl"
        >
          ×
        </button>
      </div>
    </div>
  );
};

// Conteúdo dos logs
const LogsContent = ({ logs }) => {
  // Se não tem logs
  if (logs.length === 0) {
    return (
      <div className="p-6 overflow-y-auto max-h-[60vh]">
        <div className="text-center py-8">
          <Activity size={48} className="mx-auto text-gray-400 mb-4" />
          <p className="text-gray-600">Nenhum log encontrado</p>
        </div>
      </div>
    );
  }

  // Mostrar lista de logs
  return (
    <div className="p-6 overflow-y-auto max-h-[60vh]">
      <div className="space-y-4">
        {logs.map(log => (
          <LogItem key={log.id} log={log} />
        ))}
      </div>
    </div>
  );
};

// Item individual de log
const LogItem = ({ log }) => {
  const isSuccess = log.status === 'success';
  
  return (
    <div className={`p-4 rounded-lg border-l-4 ${
      isSuccess
        ? 'bg-green-50 border-green-400'
        : 'bg-red-50 border-red-400'
    }`}>
      {/* Cabeçalho do log */}
      <div className="flex justify-between items-start mb-2">
        <span className={`font-medium ${
          isSuccess ? 'text-green-800' : 'text-red-800'
        }`}>
          {isSuccess ? '✅ Sucesso' : '❌ Erro'}
        </span>
        <span className="text-sm text-gray-500">
          {log.timestamp}
        </span>
      </div>
      
      {/* Mensagem */}
      <p className={`text-sm mb-2 ${
        isSuccess ? 'text-green-700' : 'text-red-700'
      }`}>
        {log.message}
      </p>
      
      {/* Status code se existir */}
      {log.statusCode && (
        <p className="text-xs text-gray-600">
          Status Code: {log.statusCode}
        </p>
      )}
      
      {/* Resposta se existir */}
      {log.responseData && (
        <LogDetails 
          title="Resposta" 
          data={log.responseData} 
          className="text-gray-600"
        />
      )}
      
      {/* Erro se existir */}
      {log.error && (
        <LogDetails 
          title="Erro" 
          data={log.error} 
          className="text-red-600"
        />
      )}
    </div>
  );
};

// Componente para mostrar detalhes expansíveis
const LogDetails = ({ title, data, className }) => {
  return (
    <details className="mt-2">
      <summary className={`text-xs cursor-pointer ${className}`}>
        {title}
      </summary>
      <pre className="text-xs bg-gray-100 p-2 rounded mt-1 overflow-x-auto">
        {typeof data === 'object' 
          ? JSON.stringify(data, null, 2)
          : data
        }
      </pre>
    </details>
  );
};

export default CronLogs;
